            "version": "1.0.4",
            "dist": {
                "type": "zip",
                "url": "https://repo.mage-os.org/packages/mage-os/magento-composer-installer-1.0.4.zip",
                "shasum": "851f3e513250a2663f16ec46a103bed2051d8f3f"
            },
            "require": {
                "composer-plugin-api": "^1.1 || ^2.0",
                "composer/composer": "^1.9 || ^2.0",
                "laminas/laminas-stdlib": "^3.11.0"
            },
            "replace": {
                "magento/magento-composer-installer": "0.4.0"
