                "class": "MagentoHackathon\\Composer\\Magento\\Plugin"
            },
            "autoload": {
                "psr-0": {
                    "MagentoHackathon\\Composer\\Magento": "src/"
                }
            },
            "autoload-dev": {
                "psr-4": {
                    "MagentoHackathon\\": "tests/MagentoHackathon/"
                }
            },
            "archive": {
